  const {Mo
} = useContext(CenterMobile);

  console.log(Mob)
  return (
    <div className="py-1 text-center">

        <img
          className="d-flex justify-content-center align-items-center mt-2"
          src={ImageSubject}
          alt="ddd"

        type="button"
        // onClick={()=>set}
        />
      <p>{Mob }ojon</p>
    </div>
  );
}
